                name: name,
                printMask: printMask);
            return sb.ToString();
        }
        
        public void Print(
            IPatrolGetter item,
            StructuredStringBuilder sb,
            string? name = null,
            Patrol.Mask<bool>? printMask = null)
        {
            if (name == null)
            {
                sb.AppendLine($"Patrol =>");
            }
            else
            {
                sb.AppendLine($"{name} (Patrol) =>");
            }
            using (sb.Brace())
            {
                ToStringFields(
                    item: item,
                    sb: sb,
                    printMask: printMask);
            }
        }
        
        protected static void ToStringFields(
            IPatrolGetter item,
            StructuredStringBuilder sb,
            Patrol.Mask<bool>? printMask = null)
        {
            if (printMask?.IdleTime ?? true)
            {
                sb.AppendItem(item.IdleTime, "IdleTime");
            }
            if (printMask?.Idle ?? true)
            {
                sb.AppendItem(item.Idle.FormKey, "Idle");
            }
            if (printMask?.Topics?.Overall ?? true)
            {
                sb.AppendLine("Topics =>");
                using (sb.Brace())
                {
                    foreach (var subItem in item.Topics)
                    {
                        using (sb.Brace())
                        {
                            subItem?.Print(sb, "Item");
                        }
                    }
                }
            }
            if (printMask?.Topic ?? true)
            {
                sb.AppendItem(item.Topic.FormKeyNullable, "Topic");
            }
        }
        
        #region Equals and Hash
        public virtual bool Equals(
            IPatrolGetter? lhs,
            IPatrolGetter? rhs,
            TranslationCrystal? equalsMask)
        {
            if (!EqualsMaskHelper.RefEquality(lhs, rhs, out var isEqual)) return isEqual;
            if ((equalsMask?.GetShouldTranslate((int)Patrol_FieldIndex.IdleTime) ?? true))
            {
                if (!lhs.IdleTime.EqualsWithin(rhs.IdleTime)) return false;
            }
            if ((equalsMask?.GetShouldTranslate((int)Patrol_FieldIndex.Idle) ?? true))
            {
                if (!lhs.Idle.Equals(rhs.Idle)) return false;
            }
            if ((equalsMask?.GetShouldTranslate((int)Patrol_FieldIndex.Topics) ?? true))
            {
                if (!lhs.Topics.SequenceEqual(rhs.Topics, (l, r) => ((ATopicReferenceCommon)((IATopicReferenceGetter)l).CommonInstance()!).Equals(l, r, equalsMask?.GetSubCrystal((int)Patrol_FieldIndex.Topics)))) return false;
            }
            if ((equalsMask?.GetShouldTranslate((int)Patrol_FieldIndex.Topic) ?? true))
            {
                if (!lhs.Topic.Equals(rhs.Topic)) return false;
            }
            return true;
        }
        
        public virtual int GetHashCode(IPatrolGetter item)
        {
            var hash = new HashCode();
            hash.Add(item.IdleTime);
            hash.Add(item.Idle);
            hash.Add(item.Topics);
            hash.Add(item.Topic);
            return hash.ToHashCode();
        }
        
        #endregion
        
        
        public object GetNew()
        {
            return Patrol.GetNew();
        }
        
        #region Mutagen
        public IEnumerable<IFormLinkGetter> EnumerateFormLinks(IPatrolGetter obj)
        {
            yield return FormLinkInformation.Factory(obj.Idle);
            foreach (var item in obj.Topics.WhereCastable<IATopicReferenceGetter, IFormLinkContainerGetter>()
                .SelectMany((f) => f.EnumerateFormLinks()))
            {
                yield return FormLinkInformation.Factory(item);
            }
            if (FormLinkInformation.TryFactory(obj.Topic, out var TopicInfo))
            {
                yield return TopicInfo;
            }
            yield break;
        }
        
        #endregion
        
