    internal partial class PatrolSetterTranslationCommon
    {
        public static readonly PatrolSetterTranslationCommon Instance = new PatrolSetterTranslationCommon();

        #region DeepCopyIn
        public void DeepCopyIn(
            IPatrol item,
            IPatrolGetter rhs,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask,
            bool deepCopy)
        {
            if ((copyMask?.GetShouldTranslate((int)Patrol_FieldIndex.IdleTime) ?? true))
            {
                item.IdleTime = rhs.IdleTime;
            }
            if ((copyMask?.GetShouldTranslate((int)Patrol_FieldIndex.Idle) ?? true))
            {
                item.Idle.SetTo(rhs.Idle.FormKey);
            }
            if ((copyMask?.GetShouldTranslate((int)Patrol_FieldIndex.Topics) ?? true))
            {
                errorMask?.PushIndex((int)Patrol_FieldIndex.Topics);
                try
                {
                    item.Topics.SetTo(
                        rhs.Topics
                        .Select(r =>
                        {
                            return r.DeepCopy(
                                errorMask: errorMask,
                                default(TranslationCrystal));
                        }));
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if ((copyMask?.GetShouldTranslate((int)Patrol_FieldIndex.Topic) ?? true))
            {
                item.Topic.SetTo(rhs.Topic.FormKeyNullable);
            }
        }
        
        #endregion
        
        public Patrol DeepCopy(
            IPatrolGetter item,
            Patrol.TranslationMask? copyMask = null)
        {
            Patrol ret = (Patrol)((PatrolCommon)((IPatrolGetter)item).CommonInstance()!).GetNew();
            ((PatrolSetterTranslationCommon)((IPatrolGetter)ret).CommonSetterTranslationInstance()!).DeepCopyIn(
                item: ret,
                rhs: item,
                errorMask: null,
                copyMask: copyMask?.GetCrystal(),
                deepCopy: true);
            return ret;
        }
        
        public Patrol DeepCopy(
            IPatrolGetter item,
            out Patrol.ErrorMask errorMask,
            Patrol.TranslationMask? copyMask = null)
        {
            var errorMaskBuilder = new ErrorMaskBuilder();
            Patrol ret = (Patrol)((PatrolCommon)((IPatrolGetter)item).CommonInstance()!).GetNew();
            ((PatrolSetterTranslationCommon)((IPatrolGetter)ret).CommonSetterTranslationInstance()!).DeepCopyIn(
                ret,
                item,
                errorMask: errorMaskBuilder,
                copyMask: copyMask?.GetCrystal(),
                deepCopy: true);
            errorMask = Patrol.ErrorMask.Factory(errorMaskBuilder);
            return ret;
        }
        
        public Patrol DeepCopy(
            IPatrolGetter item,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask = null)
        {
            Patrol ret = (Patrol)((PatrolCommon)((IPatrolGetter)item).CommonInstance()!).GetNew();
            ((PatrolSetterTranslationCommon)((IPatrolGetter)ret).CommonSetterTranslationInstance()!).DeepCopyIn(
                item: ret,
